import "./W3.css";
import "./css/Buttons.css";
import "./css/Text.css";

function MenuImagePad(props) {
  const data = props.imagePadData;
  console.log(data);
  const classes = "w3-padding-64 " + props.className;
  return (
    <div className={classes}>
      <div class="container">
        <h1>
          <span>
            THE
            <br />
            BLOBS
          </span>
        </h1>

        <div class="blobs_1"></div>
        <div class="blobs_2"></div>
        <div class="blobs_3"></div>
        <div class="blobs_4"></div>
        <div class="blobs_5"></div>
        <div class="blobs_6"></div>
        <div class="blobs_7"></div>
      </div>
      <img
        src={data.image.default}
        alt={data.imageAlt}
        style={{ width: data.imgSize }}
      />
      <div class="w3-center-align w3-padding-large">
        <button class="big-button">{data.buttonText}</button>
      </div>
      {props.children}
    </div>
  );
}
export default MenuImagePad;
